    #region GetAppointmentReport
    public partial class GetAppointmentReport
    {
        public String PatientImageUrl
        {
            get
            {
                return Function.GeneratePatientPictureFileName(_PictureFileName, _MedicalNo, _GCGender);
            }
        }

        public int cfQueue;

        public DateTime cfStartTime
        {
            get
            {
                int minute = Convert.ToInt32(_StartTime.Substring(3));
                int hour = Convert.ToInt32(_StartTime.Substring(0, 2));
                return new DateTime(_StartDate.Year, _StartDate.Month, _StartDate.Day, hour, minute, 0);
            }
            set
            {
                _StartTime = string.Format("{0}:{1}", value.Hour.ToString().PadLeft(2, '0'), value.Minute.ToString().PadLeft(2, '0'));
                _StartDate = new DateTime(value.Year, value.Month, value.Day);
            }
        }

        public DateTime cfEndTime
        {
            get
            {
                int minute = 0;
                int hour = 0;
                if (_EndTime != null && _EndTime != "")
                {
                    minute = Convert.ToInt32(_EndTime.Substring(3));
                    hour = Convert.ToInt32(_EndTime.Substring(0, 2));
                }
                return new DateTime(_StartDate.Year, _StartDate.Month, _StartDate.Day, hour, minute, 0);
            }
            set
            {
                _EndTime = string.Format("{0}:{1}", value.Hour.ToString().PadLeft(2, '0'), value.Minute.ToString().PadLeft(2, '0'));
            }
        }
        public String cfPatientName
        {
            get
            {
                if (_MRN != 0)
                    return string.Format("({0}) {1} ({2} menit)", _MedicalNo, _PatientName, _VisitDuration);
                return _PatientName;
            }
        }
        public String cfPatientInformation
        {
            get
            {
                if (_MRN != 0)
                    return string.Format("{0} ({1} | {2} | {3})", _PatientName, _MedicalNo, _Gender, cfDateOfBirthInString);
                return _PatientName;
            }
        }

        public String cfTanggaldanJam
        {
            get
            {
                if (!string.IsNullOrEmpty(StartDateInString))
                    return string.Format("{0} | {1}", StartDateInString, _StartTime);
                return "";
            }
        }

        public String cfMedicalNo
        {
            get
            {
                String result = "-";
                if (!String.IsNullOrEmpty(_MedicalNo))
                {
                    result = _MedicalNo;
                }
                return result;
            }
        }
        public String cfDescription
        {
            get { return String.Format("{0} : {1}", _VisitTypeName, _Notes); }
        }
        public string StartDateInString
        {
            get { return _StartDate.ToString(Helper.Constant.FormatString.DATE_FORMAT); }
        }
        public string StartDateTimeInString
        {
            get { return cfStartTime.ToString(Helper.Constant.FormatString.DATE_TIME_FORMAT); }
        }
        public string cfGroupHeaderServiceUnitAndParamedic
        {
            get { return String.Format("Service Unit : {0}, Paramedic : {1}", _ServiceUnitName, ParamedicName); }
        }
        public String StartDateInDatePickerFormat
        {
            get { return _StartDate.ToString(Helper.Constant.FormatString.DATE_PICKER_FORMAT); }
        }
        public String cfStatusTransaksiInString
        {
            get
            {
                if (_StatusTransaksi == "1")
                {
                    return "NON VOID";
                }
                else
                {
                    return "VOID";
                }
            }
        }

        public String cfDateOfBirthInString
        {
            get
            {
                if (_DOB.ToString("dd-MM-yyyy") != Constant.ConstantDate.DEFAULT_NULL)
                    return _DOB.ToString("dd-MMM-yyyy");
                return "";
            }
        }

        public String cfDateOfBirthInString1
        {
            get
            {
                if (_DOB.ToString("dd-MM-yyyy") != Constant.ConstantDate.DEFAULT_NULL)
                    return _DOB.ToString(Constant.FormatString.DATE_PICKER_FORMAT);
                return "";
            }
        }

        public String cfGender
        {
            get
            {
                if (_Gender == Constant.StandardCode.Gender.FEMALE)
                {
                    return "P";
                }
                else
                {
                    return "L";
                }
            }
        }
        public String cfInformasiKontak
        {
            get
            {
                return string.Format("{0} | {1}", _PhoneNo, _MobilePhoneNo);
            }
        }

        public Boolean cfPatientRegistration
        {
            get
            {
                if (_GCAppointmentStatus == Constant.StandardCode.AppointmentStatus.COMPLETE)
                {
                    return true;
                }
                else
                {
                    return false;
                }
            }
        }
        public Boolean cfDeleteAppointment
        {
            get
            {
                if (_GCAppointmentStatus == Constant.StandardCode.AppointmentStatus.DELETED)
                {
                    return true;
                }
                else
                {
                    return false;
                }
            }
        }

        public String cfLastUpdatedDateInString
        {
            get
            {
                string result = "";

                if (_LastUpdatedDate.ToString("dd-MM-yyyy") != Constant.ConstantDate.DEFAULT_NULL)
                {
                    result = "(" + _LastUpdatedDate.ToString(Constant.FormatString.DATE_PICKER_FORMAT) + " " + _LastUpdatedDate.ToString(Constant.FormatString.TIME_FORMAT) + ")";
                }
                return result;
            }
        }

        public String cfCreatedDateInString
        {
            get
            {
                string result = "";

                if (_CreatedDate.ToString("dd-MM-yyyy") != Constant.ConstantDate.DEFAULT_NULL)
                {
                    result = "(" + _CreatedDate.ToString(Constant.FormatString.DATE_PICKER_FORMAT) + " " + _CreatedDate.ToString(Constant.FormatString.TIME_FORMAT) + ")";
                }
                return result;
            }
        }

        public String cfCreatedDate
        {
            get { return _CreatedDate.ToString(Helper.Constant.FormatString.DATE_FORMAT); }
        }

        public String cfStartDate
        {
            get { return _StartDate.ToString(Helper.Constant.FormatString.DATE_FORMAT); }
        }

        public String cfCoverageLimitAmountInString
        {
            get
            {
                return _CoverageLimitAmount.ToString("N");
            }
        }

        public String cfDOBInString
        {
            get { return _DOB.ToString(Helper.Constant.FormatString.DATE_FORMAT); }
        }

        public String cfQueueNo
        {
            get
            {
                if (_IsWaitingList)
                {
                    return Convert.ToString(_QueueNo);
                }
                else
                {
                    if (_Session != 0)
                    {
                        string queueNo = "";

                        if (_QueueNo < 10)
                        {
                            queueNo = string.Format("0{0}", _QueueNo);
                        }
                        else
                        {
                            queueNo = Convert.ToString(_QueueNo);
                        }

                        //return string.Format("Session 0{0} | No.{1}", _Session, queueNo);
                        return string.Format("No. {0} | Session 0{1} ", queueNo, _Session);
                    }
                    else
                    {
                        return Convert.ToString(_QueueNo);
                    }
                }
            }
        }

        public Boolean cfIsFromMobileApps
        {
            get
            {
                bool result = false;
                if (_GCAppointmentMethod == Constant.StandardCode.AppointmentMethod.MOBILE_APPS)
                {
                    result = true;
                }
                return result;
            }
        }
    }
