                    return _ServiceUnitName;
            }
        }
        public String PatientImageUrl
        {
            get
            {
                if (DischargeDate.Year == 1900)
                {
                    //NULL
                    ageInYear = Function.GetPatientAgeInYear(DateOfBirth, DateTime.Now);
                    ageInMonth = Function.GetPatientAgeInMonth(DateOfBirth, DateTime.Now);
                    ageInDay = Function.GetPatientAgeInDay(DateOfBirth, DateTime.Now);
                }
                else
                {
                    ageInYear = Function.GetPatientAgeInYear(DateOfBirth, DischargeDate);
                    ageInMonth = Function.GetPatientAgeInMonth(DateOfBirth, DischargeDate);
                    ageInDay = Function.GetPatientAgeInDay(DateOfBirth, DischargeDate);
                }

                return Function.GeneratePatientPictureFileName(_PictureFileName, _MedicalNo, _GCGender, ageInYear, true);
            }
