        public String cfNoteText
        {
            get
            {
                string noteText = string.Empty;
                bool isSOAPText = !string.IsNullOrEmpty(_SubjectiveText);

                if (isSOAPText)
                {
                    if (!string.IsNullOrEmpty(_SubjectiveText))
                    {
                        noteText = string.Format(@"S:{0}{1}{2}O:{3}{4}{5}A:{6}{7}{8}P:{9}{10}{11}I:{12}{13}",
                            Environment.NewLine, _SubjectiveText, Environment.NewLine,
                            Environment.NewLine, _ObjectiveText, Environment.NewLine,
                            Environment.NewLine, _AssessmentText, Environment.NewLine,
                            Environment.NewLine, _PlanningText, Environment.NewLine,
                            Environment.NewLine, _InstructionText);
                    }
                    if (!string.IsNullOrEmpty(_ObjectiveText))
                        noteText += string.Format(@"{0}O:{1}{2}",
                            Environment.NewLine, Environment.NewLine, _ObjectiveText);
                    else
                        noteText += string.Format(@"{0}O:{1}{2}",
                            Environment.NewLine, Environment.NewLine, string.Empty);

                    if (!string.IsNullOrEmpty(_AssessmentText))
                        noteText += string.Format(@"{0}A:{1}{2}",
                            Environment.NewLine, Environment.NewLine, _AssessmentText);
                    else
                        noteText += string.Format(@"{0}A:{1}{2}",
                            Environment.NewLine, Environment.NewLine, string.Empty);

                    if (!string.IsNullOrEmpty(_PlanningText))
                        noteText += string.Format(@"{0}A:{1}{2}",
                            Environment.NewLine, Environment.NewLine, _PlanningText);
                    else
                        noteText += string.Format(@"{0}P:{1}{2}",
                            Environment.NewLine, Environment.NewLine, string.Empty);
                }
                else
                {
                    noteText = _NoteText;
                }

                return noteText;
            }
        }

        public String cfNoteText2
        {
            get
            {
                string result = string.Empty;
                if (!string.IsNullOrEmpty(_InstructionText))
                {
                    result = string.Format("{0} \r\n I : \r\n {1}", _NoteText, _InstructionText + "\r\n");
                }
                else
                {
