                    {
                        if (_ClosedDate.ToString("dd-MM-yyyy") == Constant.ConstantDate.DEFAULT_NULL || _ClosedDate.ToString("dd-MM-yyyy") == null)
                            text = "";
                        else
                            text = string.Format("Tutup Registrasi = {0}", ClosedDate.ToString(Constant.FormatString.DATE_FORMAT));
                    }
                    else
                    {
                        if (_ClosedDate.ToString("dd-MM-yyyy") == Constant.ConstantDate.DEFAULT_NULL || _ClosedDate.ToString("dd-MM-yyyy") == null)
                            text = string.Format("Tanggal Pulang = {0}", _DischargeDate.ToString(Constant.FormatString.DATE_FORMAT));
                        else
                        {
                            string textClosed = string.Format("Tutup Registrasi = {0}", ClosedDate.ToString(Constant.FormatString.DATE_FORMAT));
                            string textDischarge = string.Format("Tanggal Pulang = {0}", _DischargeDate.ToString(Constant.FormatString.DATE_FORMAT));
                            text = textClosed + ", " + textDischarge;
                        }
                    }
                }
                else
                {
                    if (_IsPlanDischarge)
                        text = string.Format("Rencana Pulang = {0}", _PlanDischargeDate.ToString(Constant.FormatString.DATE_FORMAT));
