                {
                    hasil1 = string.Format("{0} Hari", Convert.ToInt32(_LOSInDay));
                }
                if (_LOSInHour > 0)
                {
                    hasil2 = string.Format("{0} Jam", Convert.ToInt32(_LOSInHour));
