        public String cfSignaRule
        {
            get
            {
                string result = "";
                string medicationAdministration;
                if (_MedicationAdministration == null || _MedicationAdministration == "")
                {
                    medicationAdministration = "";
                }
                else
                {
                    medicationAdministration = " (" + _MedicationAdministration + ")";
                }

                if (!_IsAsRequired)
                {
                    switch (GCDosingFrequency)
                    {
                        case Constant.DosingFrequency.DAY:
                            result = string.Format("{0} x sehari {1} {2}", Frequency.ToString("G29"), NumberOfDosage.ToString("G29"), DosingUnit) + medicationAdministration;
                            break;
                        case Constant.DosingFrequency.WEEK:
                            result = string.Format("{0} x seminggu {1} {2}", Frequency.ToString("G29"), NumberOfDosage.ToString("G29"), DosingUnit) + medicationAdministration;
                            break;
                        case Constant.DosingFrequency.HOUR:
                            result = string.Format("setiap {0} jam {1} {2}", Frequency.ToString("G29"), NumberOfDosage.ToString("G29"), DosingUnit) + medicationAdministration;
                            break;
                        default:
                            break;
                    }
                }
                else
                {
                    result = "Jika diperlukan" + medicationAdministration;
                }
                return result;
            }
        }
