    #region GetSupplierEvaluationReport
    public partial class GetSupplierEvaluationReport
    {
        public String cfOrderDateInString
        {
            get
            {
                return _OrderDate.ToString(Constant.FormatString.DATE_FORMAT);
            }
        }

        public Int32 cfWaktu
        {
            get
            {
                Int32 tempWaktu = 0;

                if (_Waktu <= 3)
                {
                    tempWaktu = 5;
                }

                else if (_Waktu > 3 && _Waktu <= 5)
                {
                    tempWaktu = 4;
                }

                else if (_Waktu > 5 && _Waktu <= 7)
                {
                    tempWaktu = 3;
                }

                else if (_Waktu > 7 && _Waktu <= 9)
                {
                    tempWaktu = 2;
                }

                else if (_Waktu > 9)
                {
                    tempWaktu = 1;
                }

                return tempWaktu;
            }
        }

        public Decimal cfQtyPOPOR
        {
            get
            {
                return (_QuantityPOR / _QuantityPO) * 100;
            }
        }

        public Int32 cfJumlah
        {
            get
            {
                Int32 tempJumlah = 0;

                if (cfQtyPOPOR >= 90)
                {
                    tempJumlah = 5;
                }

                else if (cfQtyPOPOR >= 85 && cfQtyPOPOR < 90)
                {
                    tempJumlah = 4;
                }

                else if (cfQtyPOPOR >= 80 && cfQtyPOPOR < 85)
                {
                    tempJumlah = 3;
                }

                else if (cfQtyPOPOR >= 75 && cfQtyPOPOR < 80)
                {
                    tempJumlah = 2;
                }

                else if (cfQtyPOPOR < 75)
                {
                    tempJumlah = 1;
                }

                return tempJumlah;
            }
        }

        public Int32 cfPersen
        {
            get
            {
                return (cfWaktu + cfJumlah) * 10;
            }
        }
    }
