                    case Constant.DosingFrequency.DAY:
                        result = string.Format("{0} x sehari {1} {2}", Frequency.ToString("G29"), NumberOfDosage.ToString("G29"), DosingUnit);
                        break;
                    case Constant.DosingFrequency.WEEK:
                        result = string.Format("{0} x seminggu {1} {2}", Frequency.ToString("G29"), NumberOfDosage.ToString("G29"), DosingUnit);
                        break;
                    case Constant.DosingFrequency.HOUR:
                        result = string.Format("setiap {0} jam {1} {2}", Frequency.ToString("G29"), NumberOfDosage.ToString("G29"), DosingUnit);
                        break;
                    default:
